import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class IpcService {

  constructor(private  http:HttpClient) {

   }
   getipc(){
    return this.http.get("ipc/List")
   }

   getIpcById(ipc: any) {
    console.log()
    return this.http.get("ipc/List/" + ipc);
  }
}
